import React from 'react'
import Fragment from 'render-fragment';

export default class FixedRoster extends React.Component {

    render() {
        const renData = this.props.userCourses.map((data, idx) => {
            return <li key={idx}>{data}</li>
        });

        return(
            <Fragment>
                {renData}
            </Fragment>

        )
    }
}
